import React from "react";
import "./Icon.css";

export default function Icon() {
  return (
    <div className="icon">
      <img alt="pic" src="./img/icon1.png" />
      <p>Declerative</p>
      <img alt="pic" src="./img/icon2.png" />
      <p>Compenants</p>
      <img alt="pic" src="./img/icon3.png" />
      <p>Single Way</p>
      <img alt="pic" src="./img/icon4.png" />
      <p>JSX</p>
    </div>
  );
}
